import React from 'react';
import ReactDOM from 'react-dom';
import { Routes,Route,BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <>
  <BrowserRouter>
    <Routes>
      <Route path="" component={App}></Route>
      </Routes>
    </BrowserRouter>
  </>,
  document.getElementById('root')
);
